        -webkit-user-select: none;
        user-select: none;
        border-bottom: 2px solid transparent;
        outline: none;
        height: 100%;
      }
      .tabbed-pane-tab-label {
        max-width: 250px;
        white-space: pre;
        overflow: hidden;
        text-overflow: ellipsis;
        display: inline-block;
      }
      .tabbed-pane-tab-element.selected {
        border-bottom-color: #666;
      }
      .tabbed-pane-tab-element:hover {
        color: #333;
      }
      .test-case-column {
        border-radius: 6px;
        margin: 24px 0;
      }
      .test-case-column .tab-element.selected {
        font-weight: 600;
        border-bottom-color: var(--color-primer-border-active);
      }
      .test-case-column .tab-element {
        border: none;
        color: var(--color-fg-default);
        border-bottom: 2px solid transparent;
      }
      .test-case-column .tab-element:hover {
        color: var(--color-fg-default);
      }
      .test-case-title {
        flex: none;
        padding: 8px;
        font-weight: 400;
        font-size: 32px !important;
        line-height: 1.25 !important;
      }
      .test-case-location,
      .test-case-duration {
        flex: none;
        align-items: center;
        padding: 0 8px 8px;
      }
      .test-case-path {
        flex: none;
        align-items: center;
        padding: 0 8px;
      }
      .test-case-annotation {
        flex: none;
        align-items: center;
        padding: 0 8px;
        line-height: 24px;
      }
      @media only screen and (max-width: 600px) {
        .test-case-column {
          border-radius: 0 !important;
          margin: 0 !important;
        }
      }
      .test-case-project-labels-row {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
      }
      .image-diff-view .tabbed-pane .tab-content {
        display: flex;
        align-items: center;
        justify-content: center;
        position: relative;
      }
      .image-diff-view .image-wrapper img {
        flex: auto;
        box-shadow: none;
        margin: 24px auto;
        min-width: 200px;
        max-width: 80%;
      }
      .image-diff-view .image-wrapper {
        flex: auto;
        display: flex;
        flex-direction: column;
        align-items: center;
      }
      .image-diff-view .image-wrapper div {
        flex: none;
        align-self: stretch;
        height: 2em;
        font-weight: 500;
        padding-top: 1em;
        display: flex;
        flex-direction: row;
      }
      .test-result {
        flex: auto;
        display: flex;
        flex-direction: column;
        margin-bottom: 24px;
      }
      .test-result > div {
        flex: none;
      }
      .test-result video,
      .test-result img {
        flex: none;
        box-shadow: var(--box-shadow-thick);
        margin: 24px auto;
        min-width: 200px;
        max-width: 80%;
      }
      .test-result-path {
        padding: 0 0 0 5px;
        color: var(--color-fg-muted);
      }
      .test-result-error-message {
        white-space: pre;
        font-family: monospace;
        overflow: auto;
        flex: none;
        background-color: var(--color-canvas-subtle);
        border-radius: 6px;
        padding: 16px;
        line-height: initial;
        margin-bottom: 6px;
      }
      .test-result-counter {
        border-radius: 12px;
        color: var(--color-canvas-default);
        padding: 2px 8px;
      }
      @media (prefers-color-scheme: light) {
        .test-result-counter {
          background: var(--color-scale-gray-5);
        }
      }
      @media (prefers-color-scheme: dark) {
        .test-result-counter {
          background: var(--color-scale-gray-3);
        }
      }
      @media only screen and (max-width: 600px) {
        .test-result {
          padding: 0 !important;
        }
      }
      .test-file-test {
        line-height: 32px;
        align-items: center;
        padding: 2px 10px;
        overflow: hidden;
        text-overflow: ellipsis;
      }
      .test-file-test:hover {
        background-color: var(--color-canvas-subtle);
      }
      .test-file-title {
        font-weight: 600;
        font-size: 16px;
      }
      .test-file-details-row {
        padding: 0 0 6px 8px;
        margin: 0 0 0 15px;
        line-height: 16px;
        font-weight: 400;
        color: var(--color-fg-subtle);
        display: flex;
        align-items: center;
      }
      .test-file-path {
        text-overflow: ellipsis;
        overflow: hidden;
        color: var(--color-fg-subtle);
      }
      .test-file-path-link {
        margin-right: 10px;
      }
      .test-file-badge {
        flex: none;
      }
      .test-file-badge svg {
        fill: var(--color-fg-subtle);
      }
      .test-file-badge:hover svg {
        fill: var(--color-fg-muted);
      }
      .test-file-test-outcome-skipped {
        color: var(--color-fg-muted);
      }
      .test-file-test-status-icon {
        flex: none;
      }
    </style>
  </head>

  </body>
